import React, {Component} from 'react';
import 'tachyons';


class Nav extends Component {
    constructor(props){
        super(props);
        this.state={
        menuOpen:false,
        }
    }

    handleMenuClick() {
        this.setState({menuOpen:!this.state.menuOpen});
    }

    handleLinkClick() {
        this.setState({menuOpen: false});
    }
    render(){
        return (
            <nav class="dt w-100 border-box pt0 pb0 o-70 pa3 ph5-ns bg-white">
                <a class="dtc v-mid mid-gray link dim w-25" href="#" title="Home">
                    <img src="https://upload.wikimedia.org/wikipedia/en/thumb/3/3c/University_College_of_Engineering%2C_Osmania_University_logo.png/220px-University_College_of_Engineering%2C_Osmania_University_logo.png" class="dib h4" alt="Site Name" />
                </a>
                <div class="dtc v-mid w-75 tr">
                    <a class="link dim dark-red f3 f2-ns dib mr3 mr4-ns" href="#" title="About">Home</a>
                    <a class="link dim dark-red f3 f2-ns dib mr3 mr4-ns" href="#" title="Events">Events</a>
                    <a class="link dim dark-red f3 f2-ns dib mr3 mr4-ns" href="#" title="Organizing Committee">Organising Committee</a>
                    <a class="link dim dark-red f3 f2-ns dib mr3 mr4-ns" href="#" title="Previous Sponsors">Previous Sponsors</a>
                    <a class="link dim dark-red f3 f2-ns dib" href="#" title="Contact">Contact Us</a>
                    <div class="container" onclick="myFunction(this)">
                        <div class="bar1"></div>
                        <div class="bar2"></div>
                        <div class="bar3"></div>
                    </div>
                </div>
            </nav>

        );
    }
}
export default Nav;
